import React, { Component } from 'react'

export class ListOfColorPlatter extends Component {
    constructor(props) {
        super(props);
    }
  render() { 
      console.log(this.props.newPlate)
    return this.props.newPlate.map((data)=> (
        <div>
          <div key={data.id} className="main_color" style={{ backgroundColor: data.name }} onClick={this.props.onDeleteColor.bind(this, data)}>{data.name}</div>
        </div>
    )) 


  }
}

export default ListOfColorPlatter
